          "id": "6a35153a95bd1903c52123c4ba077212e6443cb2",
          "message": "⬆️ micro: Update chrono to v0.4.41 (#1350)\n\nThis PR contains the following updates:\n\n| Package | Type | Update | Change |\n|---|---|---|---|\n| [chrono](https://redirect.github.com/chronotope/chrono) |\nworkspace.dependencies | patch | `0.4.40` -> `0.4.41` |\n\n---\n\n### Release Notes\n\n<details>\n<summary>chronotope/chrono (chrono)</summary>\n\n###\n[`v0.4.41`](https://redirect.github.com/chronotope/chrono/releases/tag/v0.4.41)\n\n[Compare\nSource](https://redirect.github.com/chronotope/chrono/compare/v0.4.40...v0.4.41)\n\n#### What's Changed\n\n- Add `subsec_micros` and `subsec_millis` methods to `TimeDelta` by\n[@&#8203;ggoetz](https://redirect.github.com/ggoetz) in\n[https://github.com/chronotope/chrono/pull/1668](https://redirect.github.com/chronotope/chrono/pull/1668)\n- Deprecate `NaiveDateTime::UNIX_EPOCH` by\n[@&#8203;robertbastian](https://redirect.github.com/robertbastian) in\n[https://github.com/chronotope/chrono/pull/1670](https://redirect.github.com/chronotope/chrono/pull/1670)\n- Implement `as_seconds_f32` and `as_seconds_f64` for `TimeDelta` by\n[@&#8203;ggoetz](https://redirect.github.com/ggoetz) in\n[https://github.com/chronotope/chrono/pull/1671](https://redirect.github.com/chronotope/chrono/pull/1671)\n- chore: fix some comments by\n[@&#8203;jimmycathy](https://redirect.github.com/jimmycathy) in\n[https://github.com/chronotope/chrono/pull/1677](https://redirect.github.com/chronotope/chrono/pull/1677)\n- Add `num_days_in_month` method to `Datelike` trait by\n[@&#8203;aslilac](https://redirect.github.com/aslilac) in\n[https://github.com/chronotope/chrono/pull/1673](https://redirect.github.com/chronotope/chrono/pull/1673)\n- add `WeekdaySet`, a collection of `Weekday` that is `Copy` by\n[@&#8203;Kinrany](https://redirect.github.com/Kinrany) in\n[https://github.com/chronotope/chrono/pull/1676](https://redirect.github.com/chronotope/chrono/pull/1676)\n- WeekdaySet tweaks by [@&#8203;djc](https://redirect.github.com/djc) in\n[https://github.com/chronotope/chrono/pull/1680](https://redirect.github.com/chronotope/chrono/pull/1680)\n- Upgrade to windows-bindgen 0.61 by\n[@&#8203;djc](https://redirect.github.com/djc) in\n[https://github.com/chronotope/chrono/pull/1682](https://redirect.github.com/chronotope/chrono/pull/1682)\n- Implemented a consistent Eq trait for NaiveWeek by\n[@&#8203;Splashling1789](https://redirect.github.com/Splashling1789) in\n[https://github.com/chronotope/chrono/pull/1687](https://redirect.github.com/chronotope/chrono/pull/1687)\n- TimeZone::from_posix_tz: Treat empty TZ variable as UTC by\n[@&#8203;drinkcat](https://redirect.github.com/drinkcat) in\n[https://github.com/chronotope/chrono/pull/1691](https://redirect.github.com/chronotope/chrono/pull/1691)\n- Add support for lossy format strings by\n[@&#8203;Qelxiros](https://redirect.github.com/Qelxiros) in\n[https://github.com/chronotope/chrono/pull/1693](https://redirect.github.com/chronotope/chrono/pull/1693)\n\n</details>\n\n---\n\n### Configuration\n\n📅 **Schedule**: Branch creation - At any time (no schedule defined),\nAutomerge - At any time (no schedule defined).\n\n🚦 **Automerge**: Enabled.\n\n♻ **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\n🔕 **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/dbus2/zbus).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiIzOS4yNTcuMyIsInVwZGF0ZWRJblZlciI6IjM5LjI1Ny4zIiwidGFyZ2V0QnJhbmNoIjoibWFpbiIsImxhYmVscyI6W119-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
